import './FormButtons.css';

export default function FormButtons({ requestAddPost, ref }) {
    return (
        <div className="sec-buttons">
            <button>Voltar</button>
            <input ref={ref} onClick={requestAddPost} type="submit" value="Cadastrar" />
        </div>
    )
}
